import React from 'react';
import axios from 'axios';

function MemoryLog({ memory, setMemory }) {
  const handleRefresh = async () => {
    const res = await axios.get('http://localhost:8000/memory');
    setMemory(res.data);
  };

  if (!memory) return (
    <div style={{ textAlign: 'center', color: '#aaa', margin: '32px 0' }}>
      <span role="img" aria-label="logs" style={{ fontSize: 32 }}>📜</span>
      <div style={{ marginTop: 8 }}>No logs loaded yet. Click Refresh to load logs.</div>
      <button onClick={handleRefresh} style={{ marginTop: 16, background: '#1976d2', color: '#fff', border: 'none', borderRadius: 8, padding: '10px 28px', fontSize: 16, fontWeight: 500, cursor: 'pointer' }}>Refresh</button>
    </div>
  );
  const { input_metadata, extracted_fields } = memory;

  return (
    <div style={{ background: '#fff', padding: 20, borderRadius: 12, boxShadow: '0 2px 8px rgba(0,0,0,0.04)' }}>
      <div style={{ display: 'flex', alignItems: 'center', marginBottom: 12 }}>
        <span role="img" aria-label="logs" style={{ fontSize: 24, marginRight: 8 }}>📜</span>
        <h3 style={{ margin: 0, color: '#1976d2', fontWeight: 600 }}>Memory Log</h3>
        <button onClick={handleRefresh} style={{ marginLeft: 'auto', background: '#1976d2', color: '#fff', border: 'none', borderRadius: 8, padding: '8px 22px', fontSize: 15, fontWeight: 500, cursor: 'pointer' }}>Refresh</button>
      </div>
      <div style={{ marginBottom: 18 }}>
        <div style={{ fontWeight: 500, color: '#1976d2', marginBottom: 6 }}>Input Metadata</div>
        <div style={{ overflowX: 'auto' }}>
          <table style={{ width: '100%', fontSize: 13, borderCollapse: 'collapse', background: '#f6f8fa', borderRadius: 8 }}>
            <thead>
              <tr style={{ background: '#e3f2fd' }}>
                <th style={{ padding: 8 }}>ID</th><th>Source</th><th>Type</th><th>Timestamp</th><th>Intent</th><th>Agent</th>
              </tr>
            </thead>
            <tbody>
              {input_metadata && input_metadata.map(row => (
                <tr key={row[0]} style={{ borderBottom: '1px solid #eee' }}>
                  <td style={{ padding: 8 }}>{row[0]}</td><td>{row[1]}</td><td>{row[2]}</td><td>{row[3]}</td><td>{row[4]}</td><td>{row[5]}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
      <div>
        <div style={{ fontWeight: 500, color: '#1976d2', marginBottom: 6 }}>Extracted Fields</div>
        <div style={{ overflowX: 'auto' }}>
          <table style={{ width: '100%', fontSize: 13, borderCollapse: 'collapse', background: '#f6f8fa', borderRadius: 8 }}>
            <thead>
              <tr style={{ background: '#e3f2fd' }}>
                <th style={{ padding: 8 }}>ID</th><th>Agent</th><th>Fields</th>
              </tr>
            </thead>
            <tbody>
              {extracted_fields && extracted_fields.map(row => (
                <tr key={row[0]} style={{ borderBottom: '1px solid #eee' }}>
                  <td style={{ padding: 8 }}>{row[0]}</td><td>{row[1]}</td><td><pre style={{ whiteSpace: 'pre-wrap', wordBreak: 'break-all', background: 'none', margin: 0 }}>{row[2]}</pre></td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
}

export default MemoryLog;
